//SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/KeeperCompatible.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "src/blockchain/hardhat/contracts/MultiWordConsumerContract.sol";

contract SkyGreenContract is ERC721, ERC721URIStorage, KeeperCompatibleInterface, MultiWordConsumerContract {
    using Counters for Counters.Counter;

    Counters.Counter public tokenIdCounter;

    address account;
    uint256 immutable interval = 2 minutes;
    uint256 immutable price = 0.08 ether;
    uint256 immutable id = 0;
    uint256 lastTimeStamp;

    string[] IpfsUri = [
    "https://gateway.pinata.cloud/ipfs/QmUrCMNAFRVGzRFZnUketpBWXbXky2Ygfa6iyVzhoNQhmK",
    "https://gateway.pinata.cloud/ipfs/QmeD8eDLi2w2GSpBoxid3rnZLXo7iEeZJ2NvgghFQ3FVaw",
    "https://gateway.pinata.cloud/ipfs/QmRA2A9x1SozdHHLS84ccD4rtgdiVaaHxSGxgoKnmDPcxj",
    "https://gateway.pinata.cloud/ipfs/QmXfDRDfrDJ8KBMaR5HtscuA5fLZy4uWzycr4FwA4JkzS3",
    "https://gateway.pinata.cloud/ipfs/QmXTFYRixLuydCLyZZ1TuaDounGHGkw9aDiXEhCKYXysYq"
    ];

    event NvdiRegistered(
        bytes32 indexed requestId,
        string mean,
        string std,
        string max,
        string min,
        string uuid,
        string id
    );

    constructor( string memory _name, string memory _symbol) ERC721(_name, _symbol) {
        lastTimeStamp = block.timestamp;
        account = msg.sender;
    }

    function checkUpkeep(bytes calldata /* checkData */) external view override returns (bool upkeepNeeded, bytes memory /* performData */) {
        bool done;
        upkeepNeeded = !done && ((block.timestamp - lastTimeStamp) > interval);
    }

    function performUpkeep(bytes calldata /* performData */) external override {
        if ((block.timestamp - lastTimeStamp) > interval) {
            lastTimeStamp = block.timestamp;
            uint256 tokenId = tokenIdCounter.current() - 1;
            changeNumber(tokenId);
            _setTokenURI(tokenId, IpfsUri[0]);
        }
        // We don't use the performData in this example. The performData is generated by the Keeper's call to your checkUpkeep function
    }

    function safeMint(address _to, uint _service) external payable onlyOwner {
        require(msg.value >= _service, "The funds don't sufficient");
        payable(_to).transfer(msg.value);
        uint256 tokenId = tokenIdCounter.current();
        tokenIdCounter.increment();
        _safeMint(_to, tokenId);
        _setTokenURI(tokenId, IpfsUri[0]);
    }

    function changeNumber(uint256 _tokenId) public {
        if (numberStage(_tokenId) >= 4) {
            return;
        }
        uint256 newValue = numberStage(_tokenId) + 1;
        string memory newUri = IpfsUri[newValue];
        _setTokenURI(_tokenId, newUri);
        requestMultipleParameters(newUri);
       
    }

    function requestHook(
        bytes32 requestId,
        string memory _mean,
        string memory _std,
        string memory _max,
        string memory _min,
        string memory _uuid,
        string memory _id
    ) override public{
       emit NvdiRegistered(requestId, _mean, _std, _max, _min, _uuid, _id);
    }

        // determine the stage of number
    function numberStage(uint256 _tokenId) public view returns (uint256) {
        string memory _uri = tokenURI(_tokenId);
        // number I
        if (compareStrings(_uri, IpfsUri[0])) {
            return 0;
        }
        // number II
        if (compareStrings(_uri, IpfsUri[1])) {
            return 1;
        }
        // number III
        if (compareStrings(_uri, IpfsUri[2])) {
            return 2;
        }
        // number IV
        if (compareStrings(_uri, IpfsUri[3])) {
            return 3;
        }
        // number V
        return 4;
    }

    // helper function to compare strings
    function compareStrings(string memory a, string memory b) public pure returns (bool) {
        return (keccak256(abi.encodePacked((a))) ==
            keccak256(abi.encodePacked((b))));
    }

    // The following functions is an override required by Solidity.
    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    // The following functions is an override required by Solidity.
    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }
}

